import stock from "./stock";

const LineaStock = () => {
  return (
    <tbody class="table-light sticky-top">
      {stock.map((usuario) => {
        return (
          <tr>
            <td className="centrado">
              {/* <input
                class="form-check-input"
                type="radio"
                name="radioNoLabel"
                id="radioNoLabel1"
                /> */}
              boton
            </td>

            <td className="centrado">{usuario.cantidad}</td>
            <td className="centrado">{usuario.cantidad_minima}</td>

            <td className="centrado">{usuario.descripcion}</td>
            <td className="centrado">{usuario.tipo}</td>
          </tr>
        );
      })}
    </tbody>
  );
};

export default LineaStock;
